  const [value, getValue] = useState(" ");

  function old (num) {
    return (2022 - num);
}

  function handleChange (event) {
      getValue(event.target.value);
  }

  return <div>
      <input value = {value} onChange = {handleChange}/>
      <p>год рождения - {old(value)} </p>
  </div>

}

export default App;
